import styled from 'styled-components';


export const TitleImage = styled.div`
    height: 200px;
    width:100%;
    align-items: center;
    
    img{
        height: 100%;
        width:100%;
        
    }
    
`;
export const Background = styled.div`
    display:flex;
    justify-content:center;
    background: #F0F0F0;
    height:100vh;
`;
